#!/usr/bin/env python3


# Define DNA sequence as dna
dna = ''

# Count the number of T and t in DNA sequence
print('Number of T and t is',dna.count('T') + dna.count('t'))

# Count the number of A and a in DNA sequence
print('Number of A and a is',dna.count('A') + dna.count('a'))

# Count the number of C and c in DNA sequence
print('Number of C and c is',dna.count('C') + dna.count('c'))

# Count the number of G and g in DNA sequence
print('Number of G and g is',dna.count('G') + dna.count('g'))


# Define second DNA sequence as dna2
dna2 = ''

# Convert T to U
rna2 = dna2.replace('T','U')

# Count the number of T and U to make sure they are the same
print('DNA converted to RNA')
print('Number of T in dna2',dna2.count('T'))
print('Number of U in rna2',rna2.count('U'))

# Convert T to U and t to u
rna = dna.replace('T','U') and dna.replace('t','u')

print(rna)

# Count the number of T and t also U and u to make sure they are the same
print('DNA converted to RNA')
print('Number of T and t is',dna.count('T') + dna.count('t'))
print('Number of U and u is',rna.count('U') + rna.count('u'))





